import { Link, useParams } from "react-router-dom";
import { getRaceDetail } from "../../Redux/actions";
import Card from '../home/Card/card';
import React, { useEffect } from "react";
import fondoDefault from '../../img/fondohome1.jpg';
import { useDispatch, useSelector } from 'react-redux';




function DogDetail(){

   const {id} = useParams();
   const dispatch = useDispatch()

   const raceDetails = useSelector((state)=> state.detail)


   // useEffect(() => {
   //   dispatch(getRaceDetail(id))
   //  return dispatch(id)
   // }, [id]);
   useEffect(() => {
      dispatch(getRaceDetail(id)); // Obtener los detalles del elemento con ID 1
    }, [dispatch]);


return (
   <div key={id}>


   <div>
      <Link to='/home' id="click">
         <button className="buttonVolverD">VOLVER</button>
      </Link>
      {raceD.map((c)=>(
  <Card id={c?.id} image={c?.image} name={c?.name} temperament={c?.temperament} weight={c?.weight} /> 
))}
   </div> 
{raceDetails.length > 0 ? 
   <div>

       <div  >
           <img src={raceDetails?.image? raceDetails?.image : fondoDefault } alt="La imagen no se encuentra" className="imageDetail"/>
       </div>
       <div className="nameDetail">{raceDetails?.name}</div>
       <div className="tempNameDetail">Temperamentos</div>
       <div className="tempDetail">{raceDetails?.temperament}</div>
       <div className="pesoNameDetail" >Peso</div>
       <div className="pesoDetail">{raceDetails?.weight} kg</div>
       <div className="alturaNameDetail">Altura</div>
       <div className="alturaDetail">{raceDetails?.height} cm </div>
       <div className="liveNameDetail">AÃ±os de vida</div>
       <div className="liveDetail">{raceDetails?.life_span}</div>

    </div>
    : <p>Volver</p>

} </div>
)
}
export default DogDetail;
